import React from 'react';
import BookShelf from './BookShelf';
import Footer from './Footer';
import Book1 from "./OpeningBooks/Book1";
import Book2 from "./OpeningBooks/Book2";
import Book3 from "./OpeningBooks/Book3";
import Book4 from "./OpeningBooks/Book4";
import Book5 from "./OpeningBooks/Book5";
import Book6 from "./OpeningBooks/Book6";
import Book7 from "./OpeningBooks/Book7";
import {  useNavigate } from 'react-router-dom';


const Landing = () => {

    const navigate = useNavigate();

    return (
        <div className="flex flex-wrap items-center">
            <body className="grid grid-cols-2 gap-8 text-gray-500 sm:gap-12 sm:grid-cols-3 lg:grid-cols-6 dark:text-gray-400">
                <div className="mr-auto place-self-center lg:col-span-7">
                    <div className="flex items-center lg:justify-center">
                    <div className="mr-3 cursor-pointer hover:scale-105 ease-in-out duration-300">
                        <Book1 onClick={ () => navigate(`band/new`)}/>
                    </div>
                    <div className="mr-3 cursor-pointer hover:scale-105 ease-in-out duration-300">
                        <Book2 onClick={ () => navigate(`giraffe/new`)}/>
                    </div>
                    <div className="mr-3 cursor-pointer hover:scale-105 ease-in-out duration-300">
                        <Book3 onClick={ () => navigate(`judge/new`)}/>
                    </div>
                    <div className="mr-3 cursor-pointer hover:scale-105 ease-in-out duration-300">
                        <Book4 onClick={ () => navigate(`magic/new`)}/>
                    </div>
                </div>
                <div className="flex justify-center mt-3">
                    <div className="mr-3 cursor-pointer hover:scale-105 ease-in-out duration-300">
                        <Book5 onClick={ () => navigate(`movie/new`)}/>
                    </div>
                    <div className="mr-3 cursor-pointer hover:scale-105 ease-in-out duration-300">
                        <Book6 onClick={ () => navigate(`vacation/new`)}/>
                    </div>
                    <div className="cursor-pointer hover:scale-105 ease-in-out duration-300">
                        <Book7 onClick={ () => navigate(`wonder/new`)}/>
                    </div>
                    </div>
                </div>
            </body>
            <div className="relative h-32 w-32">
                <div className="absolute inset-x-0 bottom-0 h-16">
                    <Footer />
                </div>
                
            </div>
        </div>
    );
};

export default Landing;
